  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study was to gauge
  the degree to which boat traffic in the Missisquoi River affects the basking behavior
  of the eastern spiny  softshell turtle The data collected attempt to quantify to
  some degree the various types and extent of disturbance and the reactions shown
  by the basking turtles.  This report includes maps, charts and summaries on the
  disturbance data and turtle reactions of this study and the basking locations of
  the turtles.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
